<!DOCTYPE html>
<html lang="en">

<head>
  <meta charset="utf-8" />
  <link rel="icon" href="%PUBLIC_URL%/favicon.ico" />
  <meta name="viewport" content="width=device-width, initial-scale=1" />
  <meta name="theme-color" content="#000000" />
  <meta name="description" content="Web site created using create-react-app" />
  <meta name="viewport" content="width=device-width, initial-scale=1">
  <title>Kyle Johnson</title>
  <style>
    /* http://meyerweb.com/eric/tools/css/reset/
   v2.0 | 20110126
   License: none (public domain)
*/

    html,
    body,
    div,
    span,
    applet,
    object,
    iframe,
    h1,
    h2,
    h3,
    h4,
    h5,
    h6,
    p,
    blockquote,
    pre,
    a,
    abbr,
    acronym,
    address,
    big,
    cite,
    code,
    del,
    dfn,
    em,
    img,
    ins,
    kbd,
    q,
    s,
    samp,
    small,
    strike,
    strong,
    sub,
    sup,
    tt,
    var,
    b,
    u,
    i,
    center,
    dl,
    dt,
    dd,
    ol,
    ul,
    li,
    fieldset,
    form,
    label,
    legend,
    table,
    caption,
    tbody,
    tfoot,
    thead,
    tr,
    th,
    td,
    article,
    aside,
    canvas,
    details,
    embed,
    figure,
    figcaption,
    footer,
    header,
    hgroup,
    menu,
    nav,
    output,
    ruby,
    section,
    summary,
    time,
    mark,
    audio,
    video {
      margin: 0;
      padding: 0;
      border: 0;
      font-size: 100%;
      font-family: verdana, arial, helvetica, sans-serif;
      vertical-align: baseline;
    }

    /* HTML5 display-role reset for older browsers */
    article,
    aside,
    details,
    figcaption,
    figure,
    footer,
    header,
    hgroup,
    menu,
    nav,
    section {
      display: block;
    }

    body {
      line-height: 1;
    }

    ol,
    ul {
      list-style: none;
    }

    blockquote,
    q {
      quotes: none;
    }

    blockquote:before,
    blockquote:after,
    q:before,
    q:after {
      content: '';
      content: none;
    }

    table {
      border-collapse: collapse;
      border-spacing: 0;
    }

    .front {
      background-color: white;
      padding-top: 2px;
      padding-right: 6px;
      padding-left: 6px;
      border-top: solid rgb(95, 153, 207) 1px;
      border-left: solid rgb(95, 153, 207) 1px;
      border-right: solid rgb(95, 153, 207) 1px;
      /* border-bottom: solid white 1px; */
      color: rgb(255, 69, 0);
      font-weight: 700;
      font-size: 12px;
      margin-bottom: 1px;
    }

    .back {
      background-color: rgb(239, 247, 255);
      padding-top: 2px;
      padding-right: 6px;
      padding-left: 6px;
      border-top: solid rgb(206, 227, 248) 1px;
      border-left: solid rgb(206, 227, 248) 1px;
      border-right: solid rgb(206, 227, 248) 1px;
      /* border-bottom: solid rgb(95, 153, 207) 1px; */
      color: rgb(51, 102, 153);
      font-weight: 700;
      font-size: 12px;
      margin-bottom: 1px;
    }
  </style>
</head>

<body>
  <noscript>You need to enable JavaScript to run this app.</noscript>
  <div id="root"></div>

      This HTML file is a template.
      If you open it directly in the browser, you will see an empty page.

</html>
